import React, { useEffect, useState } from "react";

const App = () => {
  useEffect(() => {
    const range = document.querySelector('input[type="range"]');
    console.log(range);
    range.addEventListener("input", () => {
      document.getElementById("display-password-length").value = this.value;
    });
  });

  return (
    <>
      <div className="app">
        <input
          type="text"
          id="password-output"
          value="Générateur de Mdp"
          readOnly
        />

        <div className="range-container">
          <input
            type="range"
            name=""
            id="password-length"
            min="4"
            max="24"
            value="8"
            // onInput="document.getElementById('display-password-length').value=this.value"
          />
          <input
            type="text"
            name=""
            id="display-password-length"
            value="8"
            readOnly
          />
        </div>
      </div>
    </>
  );
};

export default App;
